import React,{Component} from 'react';


export default class Login extends Component{
    constructor()
    {
        super()
    }
    login()
    {
      alert("hello");
    }
    render()
    {
        return(
            <div className="formDiv">
              <center>
              <br/>
              <br/> <br/> <br/>
              <div className="myForm">              
                <form method="POST" action="/">
                  <table>
                  <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>
                  <tr> <td>Email Id</td>        <td>&nbsp;</td>            <td><input type="email" name="uname"/></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>


                 <tr> <td>Password</td>           <td>&nbsp;</td>          <td><input type="password" name="uname"/></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>

                 <tr> <td> <input type="reset"/> </td>           <td>&nbsp;</td>          <td><input type="submit" name="uname" onClick={this.login} /></td>         </tr>

                 <tr> <td>&nbsp;</td> <td>&nbsp;</td>  <td>&nbsp;</td>   </tr>

                 <tr> <td colSpan="3">Not Register? <a href="/?register" > Create an account </a></td>      </tr>


                 </table>
                 </form>
                </div>
              </center>

            </div>

        );
    }
}
